// src/index.js

import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import dotenv from "dotenv";

dotenv.config(); // dotenv를 사용하여 .env 파일 로드

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
